import { useEffect } from "react";

function EventsPage() {
  useEffect(() => {
    async function fetchData() {
      const response = await fetch("localhost:8080", { method: "GET" });

      if (!response.ok) {
        throw new Error("가져오기 실패 ㅋ");
      }

      return response;
    }

    fetchData();
  }, []);

  return <h1>EventsPage</h1>;
}
export default EventsPage;
